import Button from "react-bootstrap/Button";

const Cart = ({item}) => {
    return(
        <div className='shoppingCart'>
            <h1>My Cart</h1>
            <div className = "cartPage">
                <div className = "cartItems">


                </div>
                <div className = "total">
                    <h4>ORDER SUMMARY</h4>


                </div>




            </div>

           <Button variant="primary" href="/checkout">CHECKOUT</Button>
        </div>
    )
}

export default Cart;
